import React from 'react';

const NavBar = () => {
    return (
        <div className="container">
            <nav>
                <div className="menu-toggle">
                    <i className="fas fa-bars"> </i>
                    <i className="fas fa-times"> </i>
                </div>
                <a href="/" className="logo"> </a> 
            </nav>
        </div>
    );
};

export default NavBar;
